import React from "react";

function Header() {
  return (
    <nav class="navbar bg-light">
      <div class="container">
        <a class="navbar-brand" href="#">
          <img
            src="/logoHust.png"
            alt=""
            width="226"
            height="100"
            class="d-inline-block align-text-top"
          />
          ĐẠI HỌC BÁCH KHOA HÀ NỘI TRƯỜNG CÔNG NGHỆ THÔNG TIN VÀ TRUYỀN THÔNG
        </a>
      </div>
    </nav>
  );
}

export default Header;
